INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES (0.0, "リン", 24, 0.0, "2020/04/30 12:00:00", 10040, 102601, "2030/12/17 14:59:59", 24001, 0.0, 1, "あたしだって\nやるときはやるよ！", 1, 0);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES (0.0, "リン", 24, 0.0, "2020/04/30 12:00:00", 10040, 102601, "2030/12/17 14:59:59", 24002, 0.0, 1, "ふぅ…\nこれであたしの仕事は\n終わりだね", 1, 1);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES (0.0, "リン", 24, 0.0, "2020/04/30 12:00:00", 10040, 102601, "2030/12/17 14:59:59", 24003, 0.0, 1, "終わった終わった\n一人でもなんとか\nなるもんだね", 1, 2);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES (0.0, "リン", 24, 0.0, "2020/04/30 12:00:00", 10040, 102601, "2030/12/17 14:59:59", 24004, 0.0, 2, "やったね！\nこれでようやく\nサボれるよ…", 2, 3);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES (0.0, "リン", 24, 0.0, "2020/04/30 12:00:00", 10040, 102601, "2030/12/17 14:59:59", 24005, 0.0, 1, "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", 1, 4);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES (0.0, "リン", 24, 0.0, "2020/04/30 12:00:00", 10040, 102601, "2030/12/17 14:59:59", 24006, 0.0, 2, "あたしを敵に回した\n恐ろしさ\n思い知ったか！", 2, 5);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES (0.0, "リン", 24, 0.0, "2020/04/30 12:00:00", 10040, 102601, "2030/12/17 14:59:59", 24007, 0.0, 2, "あたしも意外と\nやるもんでしょ？", 2, 6);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES (0.0, "リン", 24, 0.0, "2020/04/30 12:00:00", 10040, 102601, "2030/12/17 14:59:59", 24008, 0.0, 4, "疲れた…\nねずみの逃げ足\n速すぎるよ…", 4, 7);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES (0.0, "リン", 24, 0.0, "2020/04/30 12:00:00", 10040, 102601, "2030/12/17 14:59:59", 24009, 0.0, 4, "このままじゃ\nまっひ～に\n叱られちゃうよ", 4, 8);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES (0.0, "リン", 24, 0.0, "2020/04/30 12:00:00", 10040, 102601, "2030/12/17 14:59:59", 24010, 0.0, 4, "まじめに\nやったんだけどな…\n悔しいな～", 4, 9);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES (0.0, "リン", 24, 0.0, "2020/04/30 12:00:00", 10040, 102601, "2030/12/17 14:59:59", 24011, 0.0, 4, "やられた…\nねずみって意外と\nてごわいね", 4, 10);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES (0.0, "リン", 24, 0.0, "2020/04/30 12:00:00", 10040, 102601, "2030/12/17 14:59:59", 24012, 0.0, 4, "おのれ～\nあたしのチーズを\n盗みやがって～！", 4, 11);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES (0.0, "リン", 24, 1.81, "2020/04/30 12:00:00", 10040, 102601, "2030/12/17 14:59:59", 24013, 0.0, 4, "疲れた…\nけど、次こそは\n守り抜くよ…", 1, 12);
